// TodoTemplate

import React from "react";
import TodoList from "./TodoList";

const Main = () => {
  return (
    <>
      <div>오늘의 할일(0)</div>
      <div>여기는 할일의 목록이 들어감</div>
      <TodoList />
    </>
  );
};

export default Main;
